->values(array(
  'lid' => '5',
  'translation' => "Le module Content, composant obligatoire du kit CCK (Content Construction Kit) permet aux administrateurs d'associer des champs personnaliss  des types de contenus. Au sein de Drupal, les types de contenus servent  dfinir les caractristiques d'une publication, y compris le titre et la description des champs affichs sur ses pages \"ajouter\" et \"diter\". Le module Content (et les modules auxiliaires inclus dans CCK) permet d'ajouter des champs personnaliss en plus des champs par dfaut \"Titre\" et \"Corps\". Les fonctionnalits de CCK sont accessible via diffrents onglets sur la <a href=\"@content-types\">page d'administration des types de contenus</a>. (Voir la <a href=\"@node-help\">page d'aide du module Node</a> pour plus d'informations sur les types de contenus).",
  'language' => 'fr',
  'plid' => '0',
  'plural' => '0',
))
->values(array(
  'lid' => '6',
  'translation' => "Lorsque vous ajoutez un champ personnalis  un type de contenu, vous dterminez son type (c'est--dire s'il doit contenir du texte, des nombres ou des rfrences  d'autres objets) et la faon dont il doit tre affich (en tant que champ ou zone de texte, liste de slection, case  cocher, bouton radio, ou champ  auto-compltement). Un champ peut prsenter plusieurs valeurs (par exemple, une \"personne\" peut disposer de plusieurs adresses courriel) ou une seule (par exemple, un \"employ\" possde un numro d'identification unique).  mesure que vous ajoutez et modifiez des champs, CCK ajuste automatiquement la structure de la base de donnes en fonction. CCK propose galement un certain nombre d'autres fonctionnalits, par exemple un cache intelligent pour vos donnes personnalises, des fonctionnalits d'import et d'export pour les dfinitions de types de contenus, ainsi qu'une intgration  d'autres modules provenant des contributions.",
  'language' => 'fr',
  'plid' => '0',
  'plural' => '0',
))
->values(array(
  'lid' => '7',
  'translation' => "Des types de champs personnaliss sont proposs par plusieurs modules optionnels inclus dans CCK (chaque module fournissant un type diffrent). La <a href=\"@modules\">page des modules</a> vous permet d'activer ou de dsactiver des composants CCK. Une installation par dfaut de CCK inclut:",
  'language' => 'fr',
  'plid' => '0',
  'plural' => '0',
))
->values(array(
  'lid' => '8',
  'translation' => "<em>Number</em>, qui ajoute des types de champs numriques (formats entier, dcimal ou rel  virgule flottante). Vous pouvez dfinir un jeu ou un intervalle de valeurs autorises. Divers formats sont disponibles pour l'affichage des donnes numriques.",
  'language' => 'fr',
  'plid' => '0',
  'plural' => '0',
))
->values(array(
  'lid' => '9',
  'translation' => "<em>Text</em>, qui ajoute des types de champs de texte. Un champ texte peut contenir du texte brut uniquement ou, optionnellement, utiliser les filtres des formats d'entre que propose Drupal pour grer en toute scurit des textes enrichis. Les champs de saisie de texte peuvent tre constitus d'une seule ligne (champ texte), de plusieurs lignes (zone de texte) ou, pour un meilleur contrle des valeurs saisies, une liste de slection, des cases  cocher ou des boutons radio. Si besoin, CCK peut valider les saisies sur la base d'un ensemble de valeurs autorises.",
  'language' => 'fr',
  'plid' => '0',
  'plural' => '0',
))
->values(array(
  'lid' => '10',
  'translation' => '<em>Node Reference</em>, qui cre des rfrences personnalises entre nuds de Drupal. En ajoutant, par exemple, un champ <em>nodereference</em> et deux types de contenus diffrents, vous pouvez facilement crer des relations complexes de type parent/enfant entre donnes (par exemple plusieurs nuds "employ" peuvent prsenter un champ <em>nodereference</em> pointant vers un mme nud "employeur").',
  'language' => 'fr',
  'plid' => '0',
  'plural' => '0',
))
->values(array(
  'lid' => '11',
  'translation' => "<em>User reference</em>, qui cre des rfrences personnalises vers les comptes des utilisateurs de votre site. En ajoutant un champ <em>userreference</em>, vous pouvez crer des relations complexes entre les utilisateurs de votre site et des publications. Ainsi, pour tracer l'implication d'un utilisateur dans une publication (au del du champ Drupal standard <em>crit par</em>), vous pouvez ajouter  un type de contenu un champ <em>userreference</em> intitul \"dit par\" pour enregistrer un lien vers la page du compte utilisateur ayant dit la publication.",
